import CardCovid from "../CardCovid";
import styles from "./Global.module.css";
import data from "../../utils/constants/indonesia";
import { useState } from "react";
import { nanoid } from "nanoid";

function Pasiens() {
   const [pasiens, setPasiens] = useState(data);



  return (
    <div className={styles.container}>
      <section className={styles.pasiens}>
        <h2 className={styles.pasien__judul}>Indonesia</h2>
        <h3 className={styles.pasien__subjudul}>Data Covid Berdasarkan indonesia</h3>
        <div className={styles.pasien__container}>
          {
            pasiens.indonesia.map((pasien) => (
              <CardCovid key={pasien.status} pasien={pasien}/> 
            ))}
        </div>
      </section>
    </div>
  );
}

export default Pasiens;
